--
-- Disparadores `inventario`
--
DROP TRIGGER IF EXISTS `actualizar_estado_descarte`;
DELIMITER $$
CREATE TRIGGER `actualizar_estado_descarte` BEFORE UPDATE ON `inventario` FOR EACH ROW BEGIN
    -- Si se marca como descarte, actualizar fecha automáticamente
    IF NEW.estado_descarte = 'descarte' AND OLD.estado_descarte = 'activo' THEN
        SET NEW.fecha_descarte = NOW();
    END IF;
    
    -- Si se restaura del descarte, limpiar campos
    IF NEW.estado_descarte = 'activo' AND OLD.estado_descarte = 'descarte' THEN
        SET NEW.fecha_descarte = NULL;
        SET NEW.observaciones_descarte = NULL;
        SET NEW.tecnico_descarte = NULL;
    END IF;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `after_delete_inventario_decrement_lote`;
DELIMITER $$
CREATE TRIGGER `after_delete_inventario_decrement_lote` AFTER DELETE ON `inventario` FOR EACH ROW BEGIN
    IF OLD.lote_id IS NOT NULL THEN
        UPDATE lotes SET cantidad = GREATEST(0, cantidad - 1) WHERE id = OLD.lote_id;
    END IF;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `after_insert_inventario_increment_lote`;
DELIMITER $$
CREATE TRIGGER `after_insert_inventario_increment_lote` AFTER INSERT ON `inventario` FOR EACH ROW BEGIN
    IF NEW.lote_id IS NOT NULL THEN
        UPDATE lotes SET cantidad = cantidad + 1 WHERE id = NEW.lote_id;
    END IF;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `after_update_inventario_adjust_lote_counts`;
DELIMITER $$
CREATE TRIGGER `after_update_inventario_adjust_lote_counts` AFTER UPDATE ON `inventario` FOR EACH ROW BEGIN
    IF OLD.lote_id IS NOT NULL AND NEW.lote_id IS NOT NULL AND OLD.lote_id <> NEW.lote_id THEN
        UPDATE lotes SET cantidad = GREATEST(0, cantidad - 1) WHERE id = OLD.lote_id;
        UPDATE lotes SET cantidad = cantidad + 1 WHERE id = NEW.lote_id;
    ELSEIF OLD.lote_id IS NULL AND NEW.lote_id IS NOT NULL THEN
        UPDATE lotes SET cantidad = cantidad + 1 WHERE id = NEW.lote_id;
    ELSEIF OLD.lote_id IS NOT NULL AND NEW.lote_id IS NULL THEN
        UPDATE lotes SET cantidad = GREATEST(0, cantidad - 1) WHERE id = OLD.lote_id;
    END IF;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `before_insert_inventario_hereda_lote`;
DELIMITER $$
CREATE TRIGGER `before_insert_inventario_hereda_lote` BEFORE INSERT ON `inventario` FOR EACH ROW BEGIN
    DECLARE v_nombre VARCHAR(255);
    DECLARE v_categoria INT;
    DECLARE v_marca VARCHAR(100);
    DECLARE v_costo DECIMAL(10,2);
    DECLARE v_tdepr INT;
    DECLARE v_imagen VARCHAR(255);
    DECLARE v_desc TEXT;
    DECLARE v_max INT;

    IF NEW.lote_id IS NOT NULL THEN
        SELECT nombre_equipo, categoria_id, marca, costo, tiempo_depreciacion, imagen, descripcion
        INTO v_nombre, v_categoria, v_marca, v_costo, v_tdepr, v_imagen, v_desc
        FROM lotes
        WHERE id = NEW.lote_id
        LIMIT 1;

        IF v_nombre IS NOT NULL THEN
            SET NEW.nombre_equipo = v_nombre;
            SET NEW.categoria_id = v_categoria;
            SET NEW.marca = v_marca;
            SET NEW.costo = v_costo;
            SET NEW.tiempo_depreciacion = v_tdepr;
            SET NEW.imagen = v_imagen;
            SET NEW.descripcion = v_desc;
        END IF;

        IF NEW.equipo_num IS NULL OR NEW.equipo_num = 0 THEN
            SELECT IFNULL(MAX(equipo_num), 0) INTO v_max FROM inventario WHERE lote_id = NEW.lote_id;
            SET NEW.equipo_num = v_max + 1;
        END IF;
    ELSE
        IF NEW.equipo_num IS NULL THEN
            SET NEW.equipo_num = 1;
        END IF;
    END IF;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `before_update_inventario_hereda_lote`;
DELIMITER $$
CREATE TRIGGER `before_update_inventario_hereda_lote` BEFORE UPDATE ON `inventario` FOR EACH ROW BEGIN
    DECLARE v_nombre VARCHAR(255);
    DECLARE v_categoria INT;
    DECLARE v_marca VARCHAR(100);
    DECLARE v_costo DECIMAL(10,2);
    DECLARE v_tdepr INT;
    DECLARE v_imagen VARCHAR(255);
    DECLARE v_desc TEXT;
    DECLARE v_next INT;

    IF NEW.lote_id IS NOT NULL THEN
        SELECT nombre_equipo, categoria_id, marca, costo, tiempo_depreciacion, imagen, descripcion
        INTO v_nombre, v_categoria, v_marca, v_costo, v_tdepr, v_imagen, v_desc
        FROM lotes
        WHERE id = NEW.lote_id
        LIMIT 1;

        IF v_nombre IS NOT NULL THEN
            -- Forzar herencia: los campos comunes siempre provienen del lote
            SET NEW.nombre_equipo = v_nombre;
            SET NEW.categoria_id = v_categoria;
            SET NEW.marca = v_marca;
            SET NEW.costo = v_costo;
            SET NEW.tiempo_depreciacion = v_tdepr;
            SET NEW.imagen = v_imagen;
            SET NEW.descripcion = v_desc;
        END IF;

        -- Si se movió de lote (o antes no tenía lote) y no se proporcionó equipo_num, asignar secuencial
        IF (OLD.lote_id IS NULL OR OLD.lote_id <> NEW.lote_id) THEN
            IF NEW.equipo_num IS NULL OR NEW.equipo_num = 0 THEN
                SELECT IFNULL(MAX(equipo_num), 0) + 1 INTO v_next FROM inventario WHERE lote_id = NEW.lote_id;
                SET NEW.equipo_num = v_next;
            END IF;
        END IF;
    END IF;
    -- Si NEW.lote_id IS NULL dejamos los campos como vienen en NEW (no los sobreescribimos)
END
$$
DELIMITER ;

